import { CgProfile } from "react-icons/cg";
import "./Nav.css";
import { useState } from "react";

const Nav = ({ outModal }) => {
  return (
    <div className="nav-container">
      <h1>Kite</h1>
      <div className="nav-right">
        <button className="btn">Add a spot</button>
        <a
          onClick={() => {
            outModal(true);
          }}
        >
          <CgProfile />
        </a>
      </div>
    </div>
  );
};

export default Nav;
